import React from 'react';
import ExpenseForm from './ExpenseForm';

const NewExpense = () => {
  return (
    <div className='new-expense' onInputExpenseSubmit={inputExpense}>
      <ExpenseForm />
    </div>
  );
};

export default NewExpense;
